import React from 'react';
import styled from 'styled-components';

// logo, icon img import
import sevLogo from '../assets/img/sev_logo@2x.png';
import loginIcon from '../assets/img/ico-top-login@2x.png';
import joinIcon from '../assets/img/ico-top-join@2x.png';
import allMenuIcon from '../assets/img/ico-allmenu.png';
import searchIcon from '../assets/img/ico-search.png';

// header 스타일 블럭
const HeaderContainer = styled.header`
  width: 1280px;
  margin: 0 auto;

`;

// util 스타일 블럭
const UtilContainer = styled.div`
  height: 41px;
  border: 1px solid black;
  display: flex;
  justify-content: flex-end;

  ul {
    display: flex;

    li {
      img {
        width: 26px;
      }
    }
  }
`;

// gnb 스타일 블럭
const GnbContainer = styled.div`
  height: 84px;
  border: 1px solid black;
  display: flex;
  justify-content: space-between;

  ul {
    display: flex;

    li {
      height: 84px;

      a {
        text-align: center;
        line-height: 84px;
        font-size: 26px;

        img {
        }
        .allMenuIcon {
          height: 20px;
        }
        .searchIcon {
          height: 24px;
        }
      }
    }
  }
`;

const header = () => {
  return (
    <HeaderContainer>
    <UtilContainer>
      <ul>
        <li>
          <a><img src={loginIcon} alt="login_icon" /></a>
        </li>
        <li>
          <a><img src={joinIcon} alt="join_icon" /></a>
        </li>
      </ul>
    </UtilContainer>
    <GnbContainer>
      <h1><img src={sevLogo} alt="header_logo" /></h1>
      <ul>
        <li>
          <a>환자/보호자</a>
        </li>
        <li>
          <a>의료인</a>
        </li>
        <li>
          <a>공감 Story</a>
        </li>
        <li>
          <a>건강정보</a>
        </li>
        <li>
          <a><img src={allMenuIcon} alt="all_menu_icon" className='allMenuIcon' /></a>
        </li>
        <li>
          <a><img src={searchIcon} alt="search_icon" className='searchIcon' /></a>
        </li>
      </ul>
    </GnbContainer>
    </HeaderContainer>
  )
}

export default header
